@jit(nopython=True)
def xor(bytestring_a, bytestring_b):

    return bytestring_a ^ bytestring_b


@jit(nopython=True)
def aes_128_ctr() -> ndarray:
    """
        Generates a new key stream by encrypting a nonce under some key using AES-128bit in CTR mode, then xor it with
        an all zero bit plaintext.

        Parameters:
            -

        Returns:
            :raises
            - key_stream (bytes) : New key stream.
    """

    # Creating now key streams does not work with numba.
    if not use_static_key_stream:
        zero_plaintext = bytearray(number_of_bytes() * number_of_blocks())
        key = urandom(number_of_bytes())
        nonce = urandom(number_of_bytes())

        # Construct an AES-CTR Cipher object with the given key and a randomly generated nonce.
        encryptor = Cipher(
            algorithms.AES(key),
            modes.CTR(nonce),
        ).encryptor()    # Collects enough key streams to encrypt a record.

        # Encrypt the all zero plaintext and get the key stream.
        key_stream = (encryptor.update(zero_plaintext) + encryptor.finalize())

        return frombuffer(key_stream, dtype='uint8', count=-1)
    else:
        return static_key_stream


@jit(nopython=True)
def encrypt_records(swap: bool, index_a: int, index_b: int, decrypt_first: bool) -> None:
    """

    """

    # Client encryption key streams.
    encryption_key_stream_a = aes_128_ctr()
    encryption_key_stream_b = aes_128_ctr()
    encryption_key_stream_c = aes_128_ctr()
    encryption_key_stream_d = aes_128_ctr()
    encryption_key_stream_e = aes_128_ctr()
    encryption_key_stream_f = aes_128_ctr()

    # Server encryption masks.
    mask_a = aes_128_ctr()
    mask_b = aes_128_ctr()
    mask_c = aes_128_ctr()
    mask_d = aes_128_ctr()

    masked_record_a = xor(record_a, mask_a)
    masked_record_b = xor(record_b, mask_b)

    if decrypt_first:
        # Gets the decryption key streams and new encryption key streams.
        decryption_key_stream_a = aes_128_ctr()
        decryption_key_stream_b = aes_128_ctr()

        # Decrypts the received records.
        masked_record_a = xor(masked_record_a, decryption_key_stream_a)
        masked_record_b = xor(masked_record_b, decryption_key_stream_b)

    if swap:
        masked_record_a, masked_record_b = masked_record_b, masked_record_a

    masked_record_a = xor(masked_record_a, encryption_key_stream_a)
    masked_record_b = xor(masked_record_b, encryption_key_stream_b)

    masked_record_a = xor(xor(masked_record_a, mask_a), mask_c)
    masked_record_b = xor(xor(masked_record_b, mask_b), mask_d)

    masked_record_a = xor(masked_record_a, encryption_key_stream_a)
    masked_record_b = xor(masked_record_b, encryption_key_stream_b)

    if swap:
        masked_record_a, masked_record_b = masked_record_b, masked_record_a

    masked_record_a = xor(masked_record_a, encryption_key_stream_c)
    masked_record_b = xor(masked_record_b, encryption_key_stream_d)

    masked_record_a = xor(masked_record_a, mask_a)
    masked_record_b = xor(masked_record_b, mask_b)

    masked_record_a = xor(masked_record_a, encryption_key_stream_c)
    masked_record_b = xor(masked_record_b, encryption_key_stream_d)

    if swap:
        masked_record_a, masked_record_b = masked_record_b, masked_record_a

    masked_record_a = xor(masked_record_a, encryption_key_stream_e)
    masked_record_b = xor(masked_record_b, encryption_key_stream_f)

    masked_record_a = xor(xor(masked_record_a, mask_a), mask_c)
    masked_record_b = xor(xor(masked_record_b, mask_b), mask_d)

    return


@jit(nopython=True)
def compare_init(index: int, permutation: ndarray, descending: bool, midpoint: int) -> None:
    """
        Sorts and encrypts two records.

        Parameters:
            - index (int) : An index of a record to be evaluated.
            - permutation (ndarray) : The order the records will be shuffled.
            - descending (bool) : Indicates the order the records should be sorted.
            - midpoint (int) : An index of a record to be evaluated.

        Returns:
            :raises
            -
    """

    index_a, index_b = index, index + midpoint

    # Evaluates whether the records should be swapped or not.
    swap = False
    permutation_a, permutation_b = permutation[index_a], permutation[index_b]
    if (permutation_a > permutation_b and not descending) or (permutation_b > permutation_a and descending):
        permutation_a, permutation_b = permutation_b, permutation_a
        swap = True

    # Updates permutation.
    permutation[index_a], permutation[index_b] = permutation_a, permutation_b

    # Executes the mpc encryption and sorting.
    decrypt_first = False
    encrypt_records(swap, index_a, index_b, decrypt_first)

    return


@jit(nopython=True)
def compare(index: int, permutation: ndarray, descending: bool, midpoint: int) -> None:
    """
        Sorts and re-encrypts two records.

        Parameters:
            - index (int) : An index of a record to be evaluated.
            - permutation (ndarray) : The order the records will be shuffled.
            - descending (bool) : Indicates the order the records should be sorted.
            - midpoint (int) : An index of a record to be evaluated.

        Returns:
            :raises
            -
    """

    index_record_a, index_record_b = index, index + midpoint

    # Evaluates whether the records should be swapped or not.
    swap = False
    permutation_a, permutation_b = permutation[index], permutation[index + midpoint]
    if (permutation_a > permutation_b and not descending) or (permutation_b > permutation_a and descending):
        permutation_a, permutation_b = permutation_b, permutation_a
        swap = True

    # Updates permutation.
    permutation[index], permutation[index + midpoint] = permutation_a, permutation_b

    # Executes the mpc encryption and sorting.
    decrypt_first = True
    encrypt_records(swap, index_record_a, index_record_b, decrypt_first)

    return


@jit(nopython=True, parallel=True)
def init(permutation: ndarray) -> None:
    """
        Performs the first layer of the bitonic sort and encrypts the records.

        Parameters:
            - permutation (ndarray) : The order the records will be shuffled.

        Returns:
            :raises
            -
    """

    partition_size = 2
    partition_midpoint = partition_size // 2

    number_of_partitions = database_size // partition_size
    descending_mask = array([0, 1] * number_of_partitions)

    # Parallelizable
    for i in prange(0, number_of_partitions):
        partition_index = i * partition_size
        descending = descending_mask[i]

        compare_init(partition_index, permutation, descending, partition_midpoint)

    return


@jit(nopython=True)
def merge_partition(partition_index: int, permutation: ndarray, descending: bool,
                    partition_midpoint: int) -> None:
    """
        Merges two bitonic sequences.

        Parameters:
            - partition_index (int) : The first index of a partition.
            - permutation (ndarray) : The order the records will be shuffled.
            - descending (bool) : Indicates the order the records should be sorted.
            - partition_midpoint (int) : Midpoint of a partition.

        Returns:
            :raises
            -
    """

    # Parallelizable
    for value in range(partition_midpoint):
        index = partition_index + value

        compare(index, permutation, descending, partition_midpoint)

    return


@jit(nopython=True, parallel=True)
def merge(permutation: ndarray, partition_size, partition_midpoint: int) -> None:
    """
        Merges the bitonic sequences of a layer.

        Parameters:
            - permutation (ndarray) : The order the records will be shuffled.
            - partition_size (int) : Size of the partition.
            - partition_midpoint (int) : Midpoint of a partition.

        Returns:
            :raises
            -
    """

    number_of_partitions = database_size // partition_size
    descending_mask = array([0, 1] * number_of_partitions)

    # Parallelizable
    for i in prange(0, number_of_partitions):
        partition_index = i * partition_size
        descending = descending_mask[i]

        merge_partition(partition_index, permutation, descending, partition_midpoint)

    return


@jit(nopython=True)
def sort_subpartition(partition_index: int, permutation: ndarray, descending: bool,
                      subpartition_index: int, subpartition_midpoint: int) -> None:
    """
        Sorts the sub-partition into a bitonic sequences.

        Parameters:
            - permutation (ndarray) : The order the records will be shuffled.
            - descending (bool) : Indicates the order the records should be sorted.
            - partition_index (int) : The first index of a partition.
            - subpartition_index (int) : The first index of a subpartition.
            - subpartition_midpoint (int) : The subpartition midpoint.

        Returns:
            :raises
            -
    """
    # Parallelizable
    for value in range(subpartition_midpoint):
        index = partition_index + subpartition_index + value

        compare(index, permutation, descending, subpartition_midpoint)

    return


@jit(nopython=True, parallel=True)
def sort_partition(partition_index: int, permutation: ndarray, descending: bool, partition_size: int) -> None:
    """
        Sorts all sub-layers into bitonic sequences.

        Parameters:
            - permutation (ndarray) : The order the records will be shuffled.
            - descending (bool) : Indicates the order the records should be sorted.
            - partition_size (int) : Size of the partition.
            - partition_index (int) : The first index of a partition.

        Returns:
            :raises
            -
    """

    for sub_layer in range(-int(log(partition_size) / log(2)) + 1, 0):
        subpartition_size = 2 ** (sub_layer * -1)
        subpartition_midpoint = subpartition_size // 2

        number_of_subpartitions = partition_size // subpartition_size

        # Parallelizable
        for i in prange(0, number_of_subpartitions):
            subpartition_index = i * subpartition_size

            sort_subpartition(partition_index, permutation, descending, subpartition_index, subpartition_midpoint)

    return


@jit(nopython=True, parallel=True)
def sort(permutation: ndarray, partition_size: int) -> None:
    """
        Sorts a layer into bitonic sequences.

        Parameters:
            - permutation (ndarray) : The order the records will be shuffled.
            - partition_size (int) : Size of the partition.

        Returns:
            :raises
            -
    """

    number_of_partitions = database_size // partition_size
    descending_mask = array([0, 1] * number_of_partitions)

    # Parallelizable
    for i in prange(0, number_of_partitions):
        partition_index = i * partition_size
        descending = descending_mask[i]

        sort_partition(partition_index, permutation, descending, partition_size)

    return


@jit(nopython=True)
def bitonic_sort() -> dict[int, int]:
    """
        Performs a random oblivious shuffling of the server's records.

        Parameters:
            -

        Returns:
            :raises
            -  permutation_indexing (dict[int, int]) : The mapping from the original record indexing to their shuffled
                                                       location.
    """

    # Creates new indexing of the shuffled records
    permutation = random.permutation(database_size)
    permutation_indexing = dict(zip([str(i) for i in range(len(permutation))], permutation))

    # Encrypts the records and sorts the first layer
    init(permutation)

    # Completes the sorting of the encrypted records
    for layer in range(2, int((log(database_size) / log(2)) + 1)):
        partition_size = 2 ** layer
        partition_midpoint = partition_size // 2

        merge(permutation, partition_size, partition_midpoint)

        sort(permutation, partition_size)

    return permutation_indexing


